import React, { Component } from 'react';
import LoginComponent from './LoginPage';

class MainApp extends Component {
    state = {
        isLoginPage: true,
        isNotesPage: true
    };
    render() {
        return (
            <div className="container-fluid">
                <LoginComponent />
            </div>
        );
    }
}

export default MainApp;
